		<div id="mw-content-text" class="mw-body-content mw-content-ltr" lang="ja" dir="ltr"><div class="mw-parser-output"><p><b>福崎 睦美</b>（ふくさき むつみ、<a href="." id="link_1"                    >1958年</a>-  ）は、<a href="." id="link_2"                      >日本</a>の<a href="." id="link_3"                      >将棋</a>の元<a href="." id="link_4"                                                                    >女流棋士</a>。旧姓兼田（かねだ）。<a href="." id="link_5"                                                    >五十嵐豊一</a>門下。<a href="." id="link_6"                                                              >日本将棋連盟</a>所属時の女流棋士番号8。<a href="." id="link_7"                                >北海道</a><a href="." id="link_8"                                >雨竜郡</a><a href="." id="link_9"                                          >幌加内町</a>生まれの<a href="." id="link_10"                               >夕張市</a>育ち。<a href="." id="link_11"                                                                                           >北海道夕張南高等学校</a>卒。
</p>
